import React from "react";
import axios from "axios";

function User() {
  const [posts, setPosts] = React.useState(null);

  React.useEffect(() => {
    axios.get(`${process.env.REACT_APP_API_URL}/tables`).then((response) => {
      setPosts(response.data);
    });
  });

  if (!posts) return null;

  return (
    <div>
      {posts.map((post) => {
        <div>
          <h1>{post}</h1>
          <p>{post.name}</p>
        </div>;
      })}
    </div>
  );
}

export default User;
